import React, { Fragment } from 'react';

const Card = () => {
  console.log('card');
  return (
    <Fragment>
      <div className="left_content">
        <div className="card">
          <div>
            <span>프로필사진</span>
            <span>이름</span>
          </div>
          <div>
            이미지슬라이드
          </div>
          <div>
            <button type="button">
              <span>좋아요</span>
              <i className="fa fa-heart-o" aria-hidden="true" />
            </button>
            <span>댓글</span>
          </div>
        </div>
      </div>
      <style jsx>
        {`
          .left_content{
            float:left;
            width:69%;
            margin-right: 1%;
          }
        `}
      </style>
    </Fragment>
  );
};

export default Card;
